impl TryFrom<&str> for Locale {
    type Error = LocaleError;
    fn try_from(value: &str) -> Result<Self, Self::Error> {
        Self::from_str(value)
    }
}

impl From<Locale> for &'static str {
    fn from(loc: Locale) -> Self {
        loc.as_str()
    }
}

impl From<Locale> for String {
    fn from(loc: Locale) -> Self {
        loc.as_str().to_string()
    }
}

impl From<&Locale> for &'static str {
    fn from(loc: &Locale) -> Self {
        loc.as_str()
    }
}
